export class EscrowManagerItem {
    handle;
    constructor(fields) {
        this.handle = fields.handle;
    }
    toJSON() {
        return {
            handle: this.handle.toString(),
        };
    }
    static fromJSON(obj) {
        return new EscrowManagerItem({
            handle: obj.handle,
        });
    }
    toMoveStruct() {
        return {
            handle: this.handle.toString(),
        };
    }
    static fromMoveStruct(obj) {
        return new EscrowManagerItem({
            handle: obj.handle,
        });
    }
}
